Sorting records and then using updateMany in MongoDB with limit<p>I am trying to update all records in my MongoDB database. I want to sort the records based on a date(updatedAt) in the ascending order. And then update a limited number of records based on its current-status(currentStatus).</p>

<p>This is how the fields are: 
<a href="https://i.stack.imgur.com/dRnym.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/dRnym.png" alt="enter image description here"></a></p>

<p>I tried this but didn't work: </p>

<pre><code>var count = 20;
var sortUpdatedAt = this.collection.find({}).sort({"updatedAt":1});
try {
    this.collection.updateMany(sortUpdatedAt,
     {"currentStatus": {$in:["ACTIVE","IDLE"]} },
     { $set: { "currentStatus" : "SHUTDOWN" } }
    ).limit(count);
} catch (e) {
    logger.error(e);
}
</code></pre>

<p>created the variable sortUpdatedAt because I read updateMany does not support .sort()</p>

