<pre><code>type Pivot struct {
    Email        string             `json:"email"`
    Base         string             `json:"base"`
}
</code></pre>

<p>And the patch (with MongoDB Update)</p>

<pre><code>setMap := bson.D{
        {"$set", setElements},
    }

res, err := collection.UpdateMany(
    ctx,
    filter,
    setMap,
)
