MongoDB get full doc after match, group, and sort<p>Order:</p>

<pre><code>{
  order_id: 1,
  order_time: ISODate(...),
  customer_id: 456,
  products: [
    {
      product_id: 1,
      product_name: "Pencil"
    },
    {
      product_id: 2,
      product_name: "Scissors"
    },
    {
      product_id: 3,
      product_name: "Tape"
    }
  ]
}
</code></pre>

<p>I have a collection with a whole bunch of documents like the above. I would like to query for the latest order for each customer who ordered Scissors.</p>

<p>That is, where there exists a "products.product_name" which equals "Scissors", group by customer_id, give me the full document where the "order_time" is the "max" for that group.</p>

<p>To find the documents, I could do like <code>find({ 'products.product_name' : "Scissors" })</code> but then I get all of the order with Scissors, I only want the most recent.</p>

<p>So, I am looking at aggregation... Mongo's "$group" aggregation stage seems to require that you do some kind of actual aggregation inside like sum or max or whatever. I am guessing there's some combination of <code>$match</code>, <code>$group</code>, and <code>$sort</code> to use here but I can't seem to quite get it working.</p>

<p>Something close:</p>

<pre><code>db.storcap.aggregate(
[
{
  $match: { 'products.product_name' : "Scissors" }
},
{
  $sort: { created_at:-1 }
},
{
  $group: {
    _id: "$customer_id", 
  }
}]
)
</code></pre>

<p>But this doesn't return the full doc and I am not sure that it's doing the sorting and grouping right.</p>

