How to export node express app for chai-http<p>I have an express app with a few endpoints and am currently testing it using mocha, chai, and chai-http. This was working fine until I added logic for a pooled mongo connection, and started building endpoints that depended on a DB connection. Basically, before I import my API routes and start the app, I want to make sure I'm connected to mongo. </p>

<p>My problem is that I'm having trouble understanding how I can export my app for chai-http but also make sure there is a DB connection before testing any endpoints.</p>

<p>Here, I am connecting to mongo, then in a callback applying my API and starting the app. The problem with this example is that my tests will start before a connection to the database is made, and before any endpoints are defined. I could move <code>app.listen</code> and <code>api(app)</code> outside of the <code>MongoPool.connect()</code> callback, but then I still have the problem of there being no DB connection when tests are running, so my endpoints will fail.</p>

<p><strong>server.js</strong></p>

<pre><code>import express from 'express';
import api from './api';
import MongoPool from './lib/MongoPool';
let app = express();
let port = process.env.PORT || 3000;
MongoPool.connect((err, success) =&gt; {
    if (err) throw err;
    if (success) {
        console.log("Connected to db.")
        // apply express router endpoints to app
        api(app);
        app.listen(port, () =&gt; {
            console.log(`App listening on port ${port}`);
        })
    } else {
        throw "Couldnt connect to db";
    }

})
export default app;
</code></pre>

<p>How can I test my endpoints using chai-http while making sure there is a pooled connection before tests are actually executed? It feels dirty writing my application in a way that conforms to the tests I'm using. Is this a design problem with my pool implementation? Is there a better way to test my endpoints with chai-http?</p>

<p>Here is the test I'm running</p>

<p><strong>test.js</strong></p>

<pre><code>let chai = require('chai');
let chaiHttp = require('chai-http');
let server = require('../server').default;;
let should = chai.should();


chai.use(chaiHttp);
//Our parent block
describe('Forecast', () =&gt; {
/*
  * Test the /GET route
  */
  describe('/GET forecast', () =&gt; {
      it('it should GET the forecast', (done) =&gt; {
        chai.request(server)
            .get('/api/forecast?type=grid&amp;lat=39.2667&amp;long=-81.5615')
            .end((err, res) =&gt; {
                res.should.have.status(200);
              done();
            });
      });
  });

});
</code></pre>

<p>And this is the endpoint I'm testing</p>

<p><strong>/api/forecast.js</strong></p>

<pre><code>import express from 'express';
import MongoPool from '../lib/MongoPool';
let router = express.Router();
let db = MongoPool.db();

router.get('/forecast', (req, res) =&gt; {
    // do something with DB here
})

export default router;
</code></pre>

<p>Thank you for any help</p>

